package dev.ginyai.mod.ignoremissing.asm;

import net.minecraft.launchwrapper.IClassTransformer;
import org.objectweb.asm.ClassReader;
import org.objectweb.asm.ClassVisitor;
import org.objectweb.asm.ClassWriter;
import org.objectweb.asm.MethodVisitor;

import static org.objectweb.asm.Opcodes.*;

public class Transformer implements IClassTransformer {

    @Override
    public byte[] transform(String name, String transformedName, byte[] basicClass) {
        if ("cpw.mods.fml.common.network.handshake.FMLHandshakeClientState$4".equals(transformedName)) {
            Plugin.logger.info("Find target class {}.", transformedName);
            ClassReader classReader = new ClassReader(basicClass);
            ClassWriter classWriter = new ClassWriter(ClassWriter.COMPUTE_FRAMES);
            ClassVisitor visitor = new ClassVisitor(ASM5, classWriter) {
                @Override
                public MethodVisitor visitMethod(int access, String name, String desc, String signature, String[] exceptions) {
                    if ("accept".equals(name) && "(Lio/netty/channel/ChannelHandlerContext;Lcpw/mods/fml/common/network/handshake/FMLHandshakeMessage;)Lcpw/mods/fml/common/network/handshake/FMLHandshakeClientState;".equals(desc)) {
                        Plugin.logger.info("Find target method. {}{}", name, desc);
                        return new MethodVisitor(ASM5, super.visitMethod(access, name, desc, signature, exceptions)) {
                            @Override
                            public void visitMethodInsn(int opcode, String owner, String name, String desc, boolean itf) {
                                if (opcode == INVOKEINTERFACE && "java/util/List".equals(owner) && "isEmpty".equals(name) && "()Z".equals(desc)) {
                                    Plugin.logger.info("Find target point. {}.{}{}", owner, name, desc);
                                    super.visitMethodInsn(INVOKESTATIC, "dev/ginyai/mod/ignoremissing/asm/Methods", "alwaysEmpty", "(Ljava/util/List;)Z", false);
                                } else {
                                    super.visitMethodInsn(opcode, owner, name, desc, itf);
                                }
                            }
                        };
                    } else {
                        return super.visitMethod(access, name, desc, signature, exceptions);
                    }
                }
            };
            classReader.accept(visitor, ClassReader.EXPAND_FRAMES);
            return classWriter.toByteArray();
        } else {
            return basicClass;
        }
    }
}
